import { useEffect, useState } from "react";

export const Menu = () => {
    const [user, setUser] = useState(null);

    useEffect(() => {
        // Supondo que os dados do usuário estejam salvos como JSON em "user"
        const userData = localStorage.getItem("user");
        if (userData) {
            setUser(JSON.parse(userData));
        }
    }, []);

    return (
        <div>
            <h1>Menu</h1>
            
        </div>
    );
}
